<script setup>
import { ref, watch, onMounted } from "vue";
import MapHeader from "./MapHeader.vue";
import { fetchMap } from "./api/fetchMap";
import { fetchPlaces } from "./api/fetchPlaces";
import { fetchConvenienceFacilities } from "./api/fetchConvenience";
import MapModal from "./MapModal.vue";

const mapContainer = ref(null);
const map = ref(null);
const userLatLng = ref(null);
const selectedFacility = ref(null);
const bikeMarkers = ref([]);
const airPumpMarkers = ref([]);
const rackMarkers = ref([]);
const repairMarkers = ref([]);
const isToggled = ref({
  bikeStations: false,
  airPumps: false,
  racks: false,
  repairShops: false
});
const isModalOpen = ref(false);

onMounted(() => {
  if (mapContainer.value) {
    const { map: mapInstance } = fetchMap(mapContainer.value, (location) => {
      userLatLng.value = location;
    });

    map.value = mapInstance;
  }
});

const toggleBikeStations = async () => {
  if (!map.value) return;

  if (!isToggled.value.bikeStations) {
    if (bikeMarkers.value.length > 0) {
      bikeMarkers.value.forEach(marker => map.value.removeLayer(marker));
      bikeMarkers.value = [];
    }

    const newMarkers = await fetchPlaces(map.value, userLatLng.value, (stationData) => {
      selectedFacility.value = {
        type: "bikeStation",
        name: stationData.stationName.replace(/^\d+\.\s*/, ""),
        address: stationData.address,
        availableBikes: stationData.availableBikes,
        facilityType: stationData.facilityType,
        operatingDays: stationData.operatingDays,
      };
    });

    bikeMarkers.value = newMarkers || [];
  } else {
    bikeMarkers.value.forEach(marker => map.value.removeLayer(marker));
    bikeMarkers.value = [];
  }

  isToggled.value.bikeStations = !isToggled.value.bikeStations;
};

const toggleConvenienceFacilities = async (type) => {
  if (!map.value) return;
  
  let targetMarkers = null;
  let toggleKey = null;

  if (type === "공기주입기") {
    targetMarkers = airPumpMarkers;
    toggleKey = "airPumps";
  } else if (type === "보관소") {
    targetMarkers = rackMarkers;
    toggleKey = "racks";
  } else if (type === "수리시설") {
    targetMarkers = repairMarkers;
    toggleKey = "repairShops";
  }

  if (!isToggled.value[toggleKey]) {
    const newMarkers = await fetchConvenienceFacilities(map.value, userLatLng.value, type, (facilityData) => {
      selectedFacility.value = {
        type: type,
        name: facilityData.name,
        address: facilityData.address,
        useYn: facilityData.useYn
      };
    });

    targetMarkers.value = newMarkers;
  } else {
    targetMarkers.value.forEach(marker => map.value.removeLayer(marker));
    targetMarkers.value = [];
  }

  isToggled.value[toggleKey] = !isToggled.value[toggleKey];
};

watch(selectedFacility, (newVal) => {
  if (newVal) {
    isModalOpen.value = true;
  }
});
</script>

<template>
  <div class="w-screen h-screen relative">
    <div ref="mapContainer" class="absolute w-full h-full z-0"></div>
    <MapHeader />

    <MapModal v-if="isModalOpen" :facility="selectedFacility" @close="isModalOpen = false" />

    <div class="relative flex top-[2.5%] w-full h-[42px] text-lg font-medium">
      <div class="ml-auto flex gap-4 max-w-[600px] flex-shrink-0 justify-end pr-8">
        <button @click="toggleBikeStations"
          :class="{
            'bg-white dark:text-black1 hover:text-black1 dark:bg-black9 dark:hover:bg-primaryRed hover:bg-primaryRed': !isToggled.bikeStations,
            'bg-primaryRed text-white dark:bg-primaryRed dark:text-white': isToggled.bikeStations
          }"
          class="flex items-center justify-center rounded-3xl gap-2 shadow-lg hover:scale-110 transition-transform duration-200">
          <svg width="26" height="24" viewBox="0 0 26 24" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect width="26" height="24" fill="url(#pattern0_273_497)"/>
<defs>
<pattern id="pattern0_273_497" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_273_497" transform="matrix(0.00195312 0 0 0.00211589 0 -0.0416667)"/>
</pattern>
<image id="image0_273_497" width="512" height="512" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
          공공자전거
        </button>

        <button @click="toggleConvenienceFacilities('수리시설')"
          :class="{
            'bg-white text-black dark:text-black1 hover:text-black1 dark:bg-black9 dark:hover:bg-black9 hover:bg-black9': !isToggled.repairShops,
            'bg-black9 text-white dark:bg-black9 dark:text-white': isToggled.repairShops
          }"
          class="flex items-center justify-center rounded-3xl gap-2 shadow-lg hover:scale-110 transition-transform duration-200">
          <svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect width="20" height="20" fill="url(#pattern0_273_500)"/>
<defs>
<pattern id="pattern0_273_500" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_273_500" transform="scale(0.00195312)"/>
</pattern>
<image id="image0_273_500" width="512" height="512" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
          수리시설
        </button>

        <button @click="toggleConvenienceFacilities('공기주입기')"
          :class="{
            'bg-white text-black dark:text-black1 dark:bg-black9 dark:hover:bg-[#1CA673] hover:bg-[#1CA673] hover:text-black1' : !isToggled.airPumps,
            'bg-[#1CA673] text-white dark:bg-[#1CA673] dark:text-white': isToggled.airPumps
          }"
          class="flex items-center justify-center rounded-3xl gap-2 shadow-lg hover:scale-110 transition-transform duration-200">
          <svg width="20" height="22" viewBox="0 0 20 22" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect width="20" height="22" fill="url(#pattern0_273_503)"/>
<defs>
<pattern id="pattern0_273_503" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_273_503" transform="matrix(0.00210769 0 0 0.00195312 -0.0791367 0)"/>
</pattern>
<image id="image0_273_503" width="512" height="512" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
          공기주입기
        </button>

        <button @click="toggleConvenienceFacilities('보관소')"
          :class="{
            'bg-white text-black dark:text-black1 dark:bg-black9 dark:hover:bg-[#1A9EFE] hover:bg-[#1A9EFE] hover:text-black1': !isToggled.racks,
            'bg-[#1A9EFE]  text-white dark:bg-[#1A9EFE]  dark:text-white': isToggled.racks
          }"
          class="flex items-center justify-center rounded-3xl gap-2 shadow-lg hover:scale-110 transition-transform duration-200">
         
<svg width="23" height="24" viewBox="0 0 23 24" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect y="0.5" width="23" height="23" fill="url(#pattern0_273_506)"/>
<defs>
<pattern id="pattern0_273_506" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_273_506" transform="scale(0.00195312)"/>
</pattern>
<image id="image0_273_506" width="512" height="512" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
          보관소
        </button>
      </div>
    </div>
  </div>
</template>

